import axios from "axios"

const BASE_URL = "https://pixabay.com/api";
const API_KEY = 'key=19685928-f191ac91b9da632ea9a4b744f';

axios.defaults.baseURL = BASE_URL;
axios.defaults.params = {
    key: API_KEY,


}

const fetchImage = (value, page) => {
    console.log('get for fetch', value, page)


    return axios
        .get('https://pixabay.com/api/?q=cat&page=1&key=&image_type=photo&orientation=horizontal&per_page=12')
        .then(response => console.log(response)).catch(err => console.log(err)).finally(console.log('finally'))
}

export default fetchImage;
